import { createSchema, addTranslations, setLanguageByName, tr } from 'react-hook-form-auto'

const role = createSchema('role', {
    role: {
        type: 'select',
        options: ['blue', 'yellow']
    },
});


export const UsuarioModel = createSchema('UsuarioModel', {
    nombre: {
        type: 'string',
        required: true,
        maxLength: 255,
    },
    apellido: {
        type: 'string',
        maxLength: 255,
    },
    email: {
        type: 'string',
        required: true,
        maxLength: 255,
    },
    id_dependencia: {
        type: 'select',
        options: ['blue', 'yellow']
    },
    estado: {
        type: 'select',
        required: true,
        options: [
            { value: '1', key: 'Activo', helperText: tr('__key__') },
            { value: '0', key: 'Inactivo', helperText: tr('__key__') }
        ],
    },
    roles: {
        type: [role],
        minChildren: 1
    }
})


setLanguageByName('es')
addTranslations({
    models: {
        UsuarioModel: {
            nombre: 'Nombre',
            apellido: 'Apellido',
            email: 'Email',
            id_dependencia: 'Dependencia',
            estado: 'Estado',
            roles: 'Roles'
        }
    },
})
